window.bookSummaryJSON = "<p>Seth Stomhale is a monster. A demi-god issued of a royal vampiric line, he wields more power in his fingertips than most can dream of. And none of it can save him from Aveka Primerius. <br> Enslaved by one of the strongest witches on Earth to protect his family, he’s retained one thread to the outside world. <br> Her.<br> <br> Blair was born to be head of the Salem coven, before they realized she was useless. Weak. No one believed in her before Seth. <br> On the run since he trusted her to protect his soul, she’s alone, battling countless hunters on her trail, hiding from friends and foes alike. <br> If anyone catches her, the queen could be able to turn Seth into one of her mindless acolytes and bring the world to its knees.<br> She has to secure Seth’s soul. Even at the cost of her own.</p>"; 
